import { createMuiTheme } from '@material-ui/core'

//Theme for Coursenator

export default theme = createMuiTheme({
    palette: {
        primary :{
            main : "#5C0090"
        },
        secondary :{
            main : "#2D283E"
        }
    },
    typography : {
        fontFamily : "Nunito"
    }
})
